const HomeListingCard = ({
  imageURL,
  homeName,
  startingPrice,
  beds,
  baths,
  sqft,
  isMultiSection
}) => {
  if (!homeName) return (null);
  return (
    <React.Fragment>
      <figure><img src={imageURL} /></figure>
      <div>
        <h5>{homeName}</h5>
      </div>
      <p>Starting Price</p>
      <p>{beds} • {baths} • {sqft}</p>
      
    </React.Fragment>
  )
};

export default HomeListingCard;
